import React from 'react';
import { Link } from 'react-router-dom';
import Routes from './Routes/Rotas'; // Certifique-se de que o caminho esteja correto

function App() {
  return (
    <div>
      <nav>
        <Link to='/home'>Home</Link>
        <Link to='/googleauth'>Google Auth</Link>
      </nav>

      {/* Renderiza o componente de rotas */}
      <Routes />
    </div>
  );
}

export default App;
